-- ----------------------------
-- View structure for ACT_ID_GROUP
-- ----------------------------
DROP VIEW IF EXISTS `ACT_ID_GROUP`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `ACT_ID_GROUP` AS select `a`.`role_id` AS `ID_`,NULL AS `REV_`,`a`.`role_name` AS `NAME_`,'assignment' AS `TYPE_` from `sys_role` `a` ;

-- ----------------------------
-- View structure for ACT_ID_MENBERSHIP
-- ----------------------------
DROP VIEW IF EXISTS `ACT_ID_MENBERSHIP`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `ACT_ID_MENBERSHIP` AS select (select `u`.`user_id` from `sys_user` `u` where (`u`.`user_id` = `ur`.`user_id`)) AS `USER_ID_`,(select `r`.`role_id` from `sys_role` `r` where (`r`.`role_id` = `ur`.`role_id`)) AS `GROUP_ID_` from `sys_user_role` `ur` ;

-- ----------------------------
-- View structure for ACT_ID_USER
-- ----------------------------
DROP VIEW IF EXISTS `ACT_ID_USER`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `ACT_ID_USER` AS (select `a`.`user_id` AS `ID_`,0 AS `REV_`,`a`.`user_name` AS `FIRST_`,'' AS `LAST_`,'' AS `EMAIL_`,`a`.`password` AS `PWD_`,'' AS `PICTURE_ID_` from `sys_user` `a`) ;
